import React from "react";

const model = {
    iPhone: ['iPhone 5','iPhone 4', 'iPhone 6', 'iPhone 7', 'iPhone 8', 'iPhone x', 'iPhone 11', 'iPhone 12', 'iPhone 6'
                , 'iPhone 13'],
    samsung: ['j5', 'a5', 'j6', 'a6', 'a9', 'a10', 's9', 's10'],

    htc: ['model1', 'model2', 'model3', 'model4', 'model5']
}

const phoneModel = (props) => {
    let x = null;
    model.props.name.map(item => {
        x = <div>
                    <h2>{props.name}</h2>
                    <p>{item}</p>
                </div>
    })

    return x;
}

export default phoneModel;
